import React from "react";
import { useLocation } from "react-router";
// import { useState } from "react";

export default function ServiceUser() {
  const location = useLocation();
  //   const [data, setData] = useState([]);

  const temp = JSON.parse(localStorage.getItem(location.state.service));

  temp.filter((object, index) => {
    if (object.id === location.state.id) {
      console.log(object.id);
      console.log(index);

      localStorage.setItem(index, { id: "hiiii" });
    }
  });
  console.log(temp);

  return (
    <div>
      {temp.map((item, i) => {
        return <h1 key={i}>{item.id}</h1>;
      })}
    </div>
  );
}
